    group: "project-dart-admins"
  }
  acls {
    role: SCHEDULER
    group: "project-dart-tryjob-access"
  }
  acls {
    role: SCHEDULER
    group: "service-account-cq"
  }
  swarming {
    builders {
      name: "presubmit-try"
      swarming_host: "chromium-swarm.appspot.com"
      swarming_tags: "vpython:native-python-wrapper"
      dimensions: "cpu:x86-64"
      dimensions: "host_class:default"
      dimensions: "os:Linux"
      dimensions: "pool:luci.dart.try"
      recipe {
        name: "presubmit/presubmit"
        cipd_package: "dart/recipe_bundles/dart.googlesource.com/recipes"
        cipd_version: "refs/heads/master"
        properties_j: "$build/goma:{\"enable_ats\":true,\"server_host\":\"goma.chromium.org\",\"use_luci_auth\":true}"
        properties_j: "$recipe_engine/isolated:{\"server\":\"https://isolateserver.appspot.com\"}"
        properties_j: "$recipe_engine/swarming:{\"server\":\"https://chromium-swarm.appspot.com\"}"
        properties_j: "clobber:true"
      }
      priority: 30
      execution_timeout_secs: 600
      caches {
        name: "browsers"
        path: "third_party/browsers"
      }
      build_numbers: YES
      service_account: "dart-luci-try-builder@dart-ci.iam.gserviceaccount.com"
    }
  }
}
